type T_Wordle = {
	lexicon: string[],
	ids: number[],
	colors: number[][],
	guesses_limit: number,
	word_size: number,
	qtd_colors: number,
	lexicon_size: number,
	layers: T_Layer[],
	map_i_to_j: number[],
	map_j_to_i: number[]
}

function create_wordle_PT(): T_Wordle {
	return create_game(_TERMO_LEXICON, _TERMO_G_IDS, 6);
}

function create_game(lexicon: string[], G_ids: number[],
	guesses_limit: number): T_Wordle {
	let N = lexicon.length;
	let M = G_ids.length;

	console.assert(M >= 1);
	console.assert(N >= M);

	let word_size = lexicon[0].length;

	let colors = compute_colors5(lexicon, G_ids);

	// qtd_colors
	let qtd_colors = 0;
	for(let i = 0; i < N; i++) {
		for(let _j = 0; _j < M; _j++) {
			qtd_colors = Math.max(qtd_colors, 1 + colors[i][_j]);
		}
	}

	let map_i_to_j = create_map_i_to_j(N, G_ids);
	let layers = create_layers(guesses_limit+1, M, qtd_colors, map_i_to_j);

	return {
		lexicon: lexicon,
		ids: create_identity_array(N),
		colors: colors,
		guesses_limit: guesses_limit,
		word_size: word_size,
		qtd_colors: qtd_colors,
		lexicon_size: N,
		layers: layers,
		map_i_to_j: map_i_to_j,
		map_j_to_i: array_create_copy(G_ids)
	}
}

function _create_game_from_colors(colors: number[][],
	G_ids: number[]): T_Wordle {
	console.assert(colors.length >= 1);

	let N = colors.length;
	let M = colors[0].length;

	console.assert(M >= 1);
	console.assert(N >= M);

	let lexicon = new Array(N);
	lexicon.fill("abcde");
	let word_size = _DEFAULT_WORD_SIZE;

	// qtd_colors
	let qtd_colors = 0;
	for(let i = 0; i < N; i++) {
		for(let _j = 0; _j < M; _j++) {
			qtd_colors = Math.max(qtd_colors, 1 + colors[i][_j]);
		}
	}

	let map_i_to_j = create_map_i_to_j(N, G_ids);
	let layers = create_layers(_DEFAULT_GUESSES_LIMIT+1, M,
		qtd_colors, map_i_to_j);

	return {
		lexicon: lexicon,
		ids: create_identity_array(N),
		colors: colors,
		guesses_limit: _DEFAULT_GUESSES_LIMIT,
		word_size: word_size,
		qtd_colors: qtd_colors,
		lexicon_size: N,
		layers: layers,
		map_i_to_j: map_i_to_j,
		map_j_to_i: array_create_copy(G_ids)
	}
}